    "2016-08-04T08:17:38.615601",nt"name": "alaska-peninsula-becharof-national-wildlife-refuges-annual-narrative-report-calendar-yea-1",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Alaska
    Peninsula and Becharof NWRs outlines Refuge accomplishments during the 1987 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, management planning, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, manpower programs, volunteer programs,
    funding, and safety is given. Habitat management is also covered; subjects include
    wetlands and wilderness areas. The wildlife section of the report discusses wildlife
    diversity, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
    marine mammals, fisheries resources, and scientific collections. The public uses
    of the Refuge described in this report include interpretive programs, hunting, fishing,
    trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, communication systems, computer systems, and
    energy conservation. Cooperative programs, economic uses of the Refuge, and items
    of interest are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
